import * as React from "react";
import { XGrid } from "@material-ui/x-grid";
import { DataGrid, GridToolbar } from "@material-ui/data-grid";
import { useDemoData } from "@material-ui/x-grid-data-generator";
import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import { makeStyles } from "@material-ui/core/styles";

export default function LocationTable() {
  const { data } = useDemoData({
    dataSet: "Commodity",
    rowLength: 200,
    maxColumns: 6
  });
  const useStyles = makeStyles({
    root: {
      width: "100%",
      padding: 10,
      backgroundColor: "#fafafa"
    }
  });
  const classes = useStyles();

  return (
    <div style={{ display: "flex", height: 520, width: "100%" }}>
      <div style={{ flexGrow: 1 }}>
        <Paper square={true} elevation={2} className={classes.root}>
          <Typography variant="h5" gutterBottom>
            Места производства
          </Typography>
        </Paper>
        <XGrid
          localeText={{
            columnMenuSortAsc: "По возрастанию",
            columnMenuSortDesc: "По убыванию",
            columnMenuFilter: "Фильтр",
            columnMenuHideColumn: "Скрыть",
            columnMenuShowColumns: "Показать колонки",
            columnMenuUnsort: "Не сортировать"
          }}
          loading={data.rows.length === 0}
          rowHeight={38}
          autoHeight={true}
          pageSize={20}
          headerHeight={100}
          rowsPerPageOptions={[5, 10, 20, 50, 100]}
          pagination
          {...data}
        />
      </div>
    </div>
  );
}
